CREATE TABLE "vsla_officer_history" (
  "id" integer NOT NULL DEFAULT nextval('vsla_officer_history_id_seq'::regclass),
  "vsla_id" integer,
  "member_id" integer,
  "role" character varying,
  "start_date" date,
  "end_date" date,
  "created_at" timestamp without time zone DEFAULT now()
);

