-- Structure for table vsla_transactions --
DROP TABLE IF EXISTS "vsla_transactions" CASCADE;
CREATE TABLE "vsla_transactions" (
  "id" integer NOT NULL DEFAULT nextval('vsla_transactions_id_seq'::regclass),
  "vsla_id" integer,
  "member_id" integer,
  "type" character varying,
  "amount" numeric NOT NULL,
  "balance_after" numeric,
  "description" text,
  "status" character varying DEFAULT 'completed'::character varying,
  "created_at" timestamp without time zone DEFAULT now(),
  "repayment_date" date,
  "interest_rate" numeric,
  "work_type" character varying,
  "days_worked" integer,
  "vendor_name" character varying,
  "receipt_url" character varying,
  "sale_reference" character varying,
  "linked_loan_id" integer
);

